import React, { useState } from "react";
import Login from "./Login";
import Dashboard from "./Dashboard";

function App() {
  const [user, setUser] = useState(null);

  return (
    <div>
      {user ? (
        <Dashboard user={user} />
      ) : (
        <Login onLogin={(name) => setUser(name)} />
      )}
    </div>
  );
}

export default App;
